window.bookSummaryJSON = "<p><b>A Top 20 Amazon Best Seller </b></p> <p><b>Number one in New Adult Romance </b></p> <p>In the world of morally corrupt teenagers, only the strongest survive....</p> <p>\"Trust only those who earn it.\" A sentiment I follow without direction but holds more consequence than ever before.&nbsp;&nbsp;</p> <p>One decision, five lives, three futures. <br> This is what's at stake.&nbsp;&nbsp;</p> <p>One night, one choice, four broken Brayshaws. <br> That is where we're headed.&nbsp;&nbsp;</p> <p>Unless I stop it. <br> I have to stop it.&nbsp;&nbsp;</p> <p>I have to remind him of what he's chosen to forget.&nbsp;&nbsp;</p> <p>My town. My choice. My ending.&nbsp;&nbsp;</p> <p><i>Reign of Brayshaw</i> is the highly anticipated conclusion to Maddoc and Raven's story and the third in the Brayshaw series. This book must be listened to after both books one and two.</p>"; 
